        public List<DirectSalesOrder> QueryDirectSalesOrders(DateTime createtimefrom,DateTime createtimeto,DateTime updatetimefrom,DateTime updatetimeto,string documentnumber,int approvalstatusvaluefrom,int approvalstatusvalueto,DateTime approvaldatetimefrom,DateTime approvaldatetimeto,string checkusername,DateTime checktimefrom,DateTime checktimeto,string checkaddress,string checkresulty,int checkstatusvaluefrom,int checkstatusvalueto,string memo,out string msg)
        {   msg=string.Empty;
